import React, { Component } from 'react'

export default class navbar extends Component {

    state = {
        count: 0
    }

    minus = () => {
        let count = this.state.count
        let countMinus = count - 10

        this.setState({
            count: countMinus
        })
    }

    plus = () => {
        let count = this.state.count
        let countPilus = count + 10

        this.setState({
            count: countPilus
        })
    }

    multiply = () => {
        let count = this.state.count
        let countMulti = count * 10

        this.setState({
            count: countMinus
        })
    }







    render() {



        return (

        <div>

            <div className='plus'>
                <button onClick={this.minus}>-</button>
                <h1>Counter | {this.state.count}</h1>
                <button onClick={this.plus}>+</button>
            </div>

            <div className="ko'paytirish">
                <button onClick={this.plus}>+</button>
                <h1>Counter | {this.state.count}</h1>
                <button onClick={this.multiply}>*</button>
            </div>

            <div className="bo'lish">
                <button onClick={this.minus}>-</button>
                <h1>Counter | {this.state.count}</h1>
                <button onClick={this.plus}>+</button>
            </div>


        </div>

        )
    }
}
